import java.util.HashMap;
import java.util.Map;

public class Main {
    public static void main(String[] args) {
        Map<Integer, String> map = new HashMap<>();
        // Initial unrelated values
        map.put(1, "One");
        map.put(2, "Two");
        map.put(3, "Three");

         // Variables to obfuscate the correct path
        int pseudoRandom = 5432;
        boolean condition = (pseudoRandom % 2 == 0);

        // Misleading write operation
        map.put(4, "Four");

        // This value does not impact the reading point
        if (!condition) {
            map.put(1, "Uno");
        }

        // Correct write operation that affects the read
        if (condition) {
            /* write */ map.put(2, "TwoAndAHalf");
        }

        // Additional operations to confuse static analysis
        map.remove(3);
        map.put(pseudoRandom, "Random");

        String value = "";
        for (int i = 0; i < 5; i++) {
            if (map.containsKey(i)) {
                value += map.get(i);
            }
        }

        // Multiple get operations that do not influence the read point
        map.get(5);
        map.get(-1);

        // Read point
        /* read */ String ret = map.get(2);
        System.out.println(ret); // Should print "TwoAndAHalf"
    }
}
